        "from datetime import datetime, timedelta\n",
        "\n",
        "def get_market_data(ticker, years=2):\n",
        "    # 1. Setup dates\n",
        "    end = datetime.now()\n",
        "    start = end - timedelta(days=years*365)\n",
        "\n",
        "    # 2. Fetch data\n",
        "    df = yf.download(ticker, start=start, end=end, auto_adjust=False, progress=False)\n",
        "\n",
        "    if df.empty:\n",
        "        return None\n",
        "\n",
        "    # 3. Select needed columns\n",
        "    data = df[['Adj Close', 'Volume']].copy()\n",
        "    data.columns = ['price', 'volume']\n",
        "\n",
        "    # 4. Fix timeline gaps (Daily frequency)\n",
        "    all_days = pd.date_range(start=data.index.min(), end=data.index.max(), freq='D')\n",
        "    data = data.reindex(all_days)\n",
        "\n",
        "    # 5. Fill missing values\n",
        "    data['price'] = data['price'].ffill()\n",
        "    data['volume'] = data['volume'].fillna(0)\n",
        "\n",
        "    # 6. Compute log returns\n",
        "    data['log_return'] = np.log(data['price'] / data['price'].shift(1))\n",
        "\n",
        "    # Remove first NaN caused by shift\n",
        "    data = data.dropna()\n",
        "\n",
        "    # 7. Final cleanup\n",
        "    data.index.name = 'date'\n",
        "    data.sort_index(ascending=False,inplace=True)\n",
        "\n",
        "    return data\n",
